import React from 'react';
import {Bar, Logo} from './styles';
// LogoIcon from '../../asset/icon/logo.png';

interface Props {
	logo: string;
	locations: [];
}

const SideBar = ({logo, locations}: Props) => (
	<Bar>
		<Logo src="public/icon/logo.png" />
	</Bar>
);

export default SideBar;
